text:
 @papadordebotafoguense5571  Nota oficial do Fluminense no dia 6/07: 

"O uruguaio, Abel Hernández, segue com uma inflamação no tendão de aquiles e sem previsão de retorno para o gramado, enquanto que com Bobadilla, o atacante paraguaio está fazendo ainda transição para retornar pro campo"

Com o Caio Paulista é certo. Agora com Abel ainda não. Ele tava com inflamação no tendão.

 @davidferreira3799   quem tem que procurar o que fazer é vc ao invés de ver jogos do rival, isso dá audiência sabia? Comemora lá na casa de vcs👀
Mano, eu estudo, ajudo nos afazeres de casa, ajudo minha avó com feira, carrego água, em feira de sexta e sábado eu carrego frete (com as medidas de saúde claro) e entre outras coisas.... E vc me chama de desocupado sem ter o que fazer? Kkkkkkk revoltado com o fato da tradição né
Vai continuar sendo o 3° maior da capital náufrago 👍🏻👍🏻👍🏻👍🏻👌🏻👌🏻

